__CONSTANT_RULE = {
  getIndex: function () {
    var _idx = ++window['INDEX'] || (window['INDEX'] = 0);
    return _idx + 1;
  },
  li_option: function ($item) {
    var _return = '';
    /*topLine*/ if ($item.dep1) {
      _return += ' t-divide';
    }
    /*compareUpdate*/ if ($item.pubUp && $item.devUp) {
      if ($item.pubUp > $item.devUp) {
        _return += ' is-different';
      }
    }
    /*isDone*/ if ($item.stateHTML && $item.stateJS) {
      if ($item.stateHTML && $item.stateJS) {
        _return += ' is-done';
      }
    }
    /* 상태라인 */ if ($item.stateLine) {
      if ($item.stateLine == 'ing') {
        _return += ' state_ing';
      }
      if ($item.stateLine == 'edit') {
        _return += ' state_edit';
      }
      if ($item.stateLine == 'del') {
        _return += ' state_del';
      }
    }
    return _return;
  },
  path: function () {
    return '..' + this.url;
  },
  getfileName: function ($item) {
    var aURL = $item.url.split('/');
    return aURL[aURL.length - 1];
  },
};

var _data = { _temp_dep1: '' };
